import React from 'react'
import ShowUser from '../components/ShowUser'
import Header from '../components/Header'

const ShowUserInfo = () => {
  return (
    <div>
      <center><Header /></center>
      <ShowUser/>
    </div>
  )
}

export default ShowUserInfo
